import React from "react";
import FoodCard from "./FoodCard";
import FoodMenu from "./FoodMenu";
import Discount from './Discount';


const MenuWrapper = () => {
  return (
    <div style={{ backgroundColor: "#E5E5E5", display: "flex", flexDirection: 'column', }}>
      
      <div><FoodMenu /></div>
      <div><FoodCard /></div>
      <div><Discount/></div> 
    </div>
  );
};
export default MenuWrapper;
